import React, { useState, useEffect } from "react";
import Navbar from "../Components/Navbar";
import Carou from "../Components/Carou";
import Footer from "../Components/Footer";
import Card from "../Components/Card";
import axios from "axios";

const Home = () => {
  const [curdata, setdata] = useState([]);

  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/foodData");
      setdata(response.data);
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      <div className="nav ">
        <Navbar />
      </div>
      <Carou />
      <Card />
      <Card />
      <Card />

      <div style={{ backgroundColor: "lightblue" }}>
        <div className="container">
          {Array.isArray(curdata) && curdata.length >= 2 ? (
            <>
              {/* Destructuring and rendering for curdata[0] */}
              {curdata[0].map(({ _id, CategoryName, name, img, options, description }) => (
                <div key={_id}>
                  <p>CategoryName: {CategoryName}</p>
                  <p>Name: {name}</p>
                  {/* Add additional properties as needed */}
                </div>
              ))}

              {/* Destructuring and rendering for curdata[1] */}
              {curdata[1].map(({_id,CategoryName }) => (
                <div key={_id}>
                  <p>CategoryName: {CategoryName}</p>
                 
                  {/* Add additional properties as needed */}
                </div>
              ))}
            </>
          ) : (
            <div>Ternary Operator condition failed</div>
          )}
        </div>
        <Footer />
      </div>
    </>
  );
};

export default Home;
